        "es-419": {
          "title": "Evento de Apple — 7 de septiembre",
          "description": "Mira el evento especial de Apple y descubre las novedades: Phone 14, iPhone 14 Pro, Apple Fitness+, Apple Watch Ultra, Apple Watch Series 8, AirPods Pro y mucho más.\n\n00:00:00 Introduction\n00:06:40 Apple Watch Series 8\n00:20:17 Apple Watch SE\n00:23:01 Apple Watch Ultra\n00:40:18 AirPods Pro\n00:48:11 iPhone 14\n01:09:27 iPhone 14 Pro\n\n'Dancing In The Shadows (feat. Clementine Douglas)' - TSHA https://apple.co/TSHA\n'There You Go' - Billy Lemos https://apple.co/BillyLemos\n'Luv Like' - Nia Archives https://apple.co/NiaArchives\n'Watch Me Now (feat. Koda & VAAAL)' - The Crystal Method https://apple.co/TheCrystalMethod\n'Y Grito' - Angélica Garcia https://apple.co/AngélicaGarcia\n'On the Verge (Safari Riot Remix)' - Skott https://apple.co/Skott\n'UP UP AND AWAY' - ill peach https://apple.co/illpeach\n'Signs' - Saint Mesa & Shells https://apple.co/SaintMesa https://apple.co/Shells\n'Voodoo' - Badshah, J Balvin, Tainy https://apple.co/BadshahJBalvinTainy\n'Selfish Soul' - Sudan Archives https://apple.co/SudanArchives\n'I Can Only Whisper (feat. BADBADNOTGOOD)' - Charlotte Day Wilson https://apple.co/CharlotteDayWilson\n'On The Ground' - Grace Ives https://apple.co/GraceIves\n'Firefly' - Shygirl https://apple.co/Shygirl\n'Big Boy' - Payday https://apple.co/Payday\n'Whatever Tomorrow (Soulwax Remix)' - Chet Faker https://apple.co/ChetFakerSoulwax\n'Where You're Not' - sadie https://apple.co/sadie\n'Found' - Toulouse https://apple.co/Toulouse\n'Biggest' - Idris Elba https://apple.co/IdrisElba\n'THE MOVE' - Space Rangers https://apple.co/SpaceRangers\n'Gravity' - Beach Bunny https://apple.co/BeachBunny\n'Focus' - Malou https://apple.co/Malou\n'He Who Runs With the Flock Inevitably Follows Asses' - Cid Rim https://apple.co/CidRim2022\n'Wild Fantasy' - Guerilla Toss https://apple.co/GuerillaToss\n‘Severance: Main Titles’ - Theodore Shapiro https://apple.co/TheodoreShapiro\n\nSi quieres seguir disfrutando la música de la presentación de Apple, échale un vistazo a la lista de reproducción del evento en Apple Music.\n\n#AppleEvent #AppleKeynote\n\nEl iPhone 14, iPhone 14 Plus, iPhone 14 Pro y iPhone 14 Pro Max están sujetos a los reglamentos de la FCC, así como a las leyes de protección al consumidor, disposiciones contractuales y otras leyes federales o estatales. Estos productos no se pueden vender ni enviar mientras no se complete el proceso de autorización de la FCC."
        },
        "ko": {
          "title": "Apple 이벤트 - 9월 8일",
          "description": "특별한 최신 Apple 이벤트를 통해 iPhone 14, iPhone 14 Pro, Apple Fitness+, Apple Watch Ultra, Apple Watch Series 8, AirPods Pro 등에 대해 자세히 알아보는 시간을. \n\n00:00:00 Introduction\n00:06:40 Apple Watch Series 8\n00:20:17 Apple Watch SE\n00:23:01 Apple Watch Ultra\n00:40:18 AirPods Pro\n00:48:11 iPhone 14\n01:09:27 iPhone 14 Pro\n\n'Dancing In The Shadows (feat. Clementine Douglas)' - TSHA https://apple.co/TSHA\n'There You Go' - Billy Lemos https://apple.co/BillyLemos\n'Luv Like' - Nia Archives https://apple.co/NiaArchives\n'Watch Me Now (feat. Koda & VAAAL)' - The Crystal Method https://apple.co/TheCrystalMethod\n'Y Grito' - Angélica Garcia https://apple.co/AngélicaGarcia\n'On the Verge (Safari Riot Remix)' - Skott https://apple.co/Skott\n'UP UP AND AWAY' - ill peach https://apple.co/illpeach\n'Signs' - Saint Mesa & Shells https://apple.co/SaintMesa https://apple.co/Shells\n'Voodoo' - Badshah, J Balvin, Tainy https://apple.co/BadshahJBalvinTainy\n'Selfish Soul' - Sudan Archives https://apple.co/SudanArchives\n'I Can Only Whisper (feat. BADBADNOTGOOD)' - Charlotte Day Wilson https://apple.co/CharlotteDayWilson\n'On The Ground' - Grace Ives https://apple.co/GraceIves\n'Firefly' - Shygirl https://apple.co/Shygirl\n'Big Boy' - Payday https://apple.co/Payday\n'Whatever Tomorrow (Soulwax Remix)' - Chet Faker https://apple.co/ChetFakerSoulwax\n'Where You're Not' - sadie https://apple.co/sadie\n'Found' - Toulouse https://apple.co/Toulouse\n'Biggest' - Idris Elba https://apple.co/IdrisElba\n'THE MOVE' - Space Rangers https://apple.co/SpaceRangers\n'Gravity' - Beach Bunny https://apple.co/BeachBunny\n'Focus' - Malou https://apple.co/Malou\n'He Who Runs With the Flock Inevitably Follows Asses' - Cid Rim https://apple.co/CidRim2022\n'Wild Fantasy' - Guerilla Toss https://apple.co/GuerillaToss\n‘Severance: Main Titles’ - Theodore Shapiro https://apple.co/TheodoreShapiro\n\nApple Event의 음악을 나중에도 듣고 싶다면. Apple Music에서 키노트 플레이리스트를 검색하세요. \n\n#AppleEvent #AppleKeynote\n\niPhone 14, iPhone 14 Plus, iPhone 14 Pro, 그리고 iPhone 14 Pro Max는 FCC 규약은 물론 소비자 보호 정책, 구매 계약서, 그리고 기타 다른 연방 및 주 법에 명기된 조항을 따릅니다. FCC의 승인 과정이 끝날 때까지 기기를 판매하거나 배송할 수 없습니다."
