hone 14 Pro Max 遵循美国联邦通信委员会 (FCC) 颁布的各项规则，以及美国联邦或州法律的消费者权益保护条款、合同条款及其他相关条款。产品需待 FCC 批准流程完成后方可销售或出货。"
