          "title": "Eu Tirei 4.120 Polaroids em 99 Dias",
          "description": "99 Original, 1/1 Polaroids por LP ► https://originals.com\nEm 21 de agosto de 2021, fui lançado em um brainstorming criativo que uniu cada pedaço da\nminha vida no passado, presente e futuro. Os 99 dias seguintes determinariam a jornada mais\ntransformadora da minha vida...\nEu me forcei para as profundezas mentais e físicas mais distantes enquanto caminhava 84.029\nmilhas ao redor do mundo com uma câmera Polaroid.\nDurante esse tempo, quebrei ossos, testemunhei milagres, quase cortei minha família,\nexperimentei dependência de substâncias, viajei com os mais ricos do mundo, me apaixonei\n(mais de uma vez), vivi perigosamente no presente e concluí com 99 dos momentos mais\nsignificativos da minha vida capturada em filme tangível.\nEsta é a história de 99 Originais.\n\nSIGA 99 ORIGINAIS:\nDISCORD: https://discord.com/invite/originalsdao\nINSTAGRAM: https://www.instagram.com/99originals/\nTWITTER: https://twitter.com/originalsdao\nINSCREVA-SE NOS VLOGS! ► http://bit.ly/Subscribe2Logan\nEditor-chefe:\nHayden Hillier-Smith @HillierSmith\n\nME ADICIONE NO:\nINSTAGRAM: https://www.instagram.com/LoganPaul/\nTWITTER: https://twitter.com/LoganPaul\nAssista ao nosso podcast IMPAULSIVE ► https://www.youtube.com/impaulsive\nou clipes IMPULSIVE► https://www.youtube.com/impaulsiveclips\nEu sou um freelancer de 27 anos que vive em Porto Rico. Essa é minha vida.\nhttps://www.youtube.com/LoganPaulVlogs\n\nCapítulos:\n0:00 Introdução\n1:24 #56 UpDog\n2:12 #34 Mermaids Don’t Exist (Anymore)\n3:12 #9 Exit My Orbit\n4:08 #28 Jake Paul Beats Tyron Woodley\n5:09 #29 Victory Lap\n5:47 #75 Ephelides\n6:33 #31 Mike Tyson’s Pigeons\n7:30 #92 Cannibal\n8:23 #81 Black Mirror\n9:19 #74 Salvador Pyramid\n10:02 #51 Stonehenge\n10:59 #58 Was Has Gas Du Gedacht\n11:59 #16 A Demolition Of The Third Metacarpal\n13:00 #41 The April Fool\n13:45 #78 A Very Liberating Experience\n14:38 #94 Beautiful Nowhere\n15:27 #73 Flightless\n16:20 #12 The Mountain\n17:02 #25 Whale?\n18:02 #7